import React from "react";

function Operators(){
    return (
        <div className="container">
            <button className="container-operators">รท</button>
            <button className="container-operators">X</button>
            <button className="container-operators">+</button>
            <button className="container-operators">-</button>
        </div>
       
    )
}

export default Operators;
